INSERT INTO `categorytranslation` (`idcategorytranslation`, `name`, `shortdescription`, `description`, `categoryid`, `languageid`, `seo`, `keyword_title`, `keyword`, `keyword_description`) VALUES (2231,'Kosmetyki','','',751,1,'kosmetyki','','',''),(2235,'Żywność','<p>\r\n	Jedzenie – pokarm, żywność, to, co się wprowadza do organizmu, by zapewnić mu odpowiednie substancje do działania i odbudowy (inaczej: jadło, pokarm); także czynność spożywania pokarmu.</p>','',750,1,'zywnosc','','',''),(2236,'Ubrania','<p>\r\n	W swojej ofercie mamy niepowtarzalne wzory ubrań z całego świata. Nie przepłacaj i wybierz coś dla siebie u nas.</p>','',756,1,'ubrania','','',''),(2237,'Artykuły chemiczne','<p>\r\n	<span style=\"font-family:arial, sans-serif;font-size:small;line-height:16px;\">Mydło, </span><em style=\"font-weight:bold;font-style:normal;color:rgb(0,0,0);font-family:arial, sans-serif;font-size:small;line-height:16px;\">Artykuły</em><span style=\"font-family:arial, sans-serif;font-size:small;line-height:16px;\"> higieniczne, Płyny i mleczka do czyszczenia, Odświeżacze powietrza, Płyny do mycia naczyń, Spraye do czyszczenia, Środki do wc, Gąbki...</span></p>','',752,1,'artykuly-chemiczne','','',''),(2238,'Książki i multimedia','<p>\r\n	Książka – dokument piśmienniczy, zapis myśli ludzkiej, raczej obszerny, w postaci publikacji wielostronicowej o określonej liczbie stron, o charakterze trwałym.<br />\r\n	Dzisiejsza postać książki wywodzi się od kodeksu, czyli kartek połączonych grzbietem.</p>','',753,1,'ksiazki-i-multimedia','','',''),(2239,'Obuwie','<p>\r\n	Obuwie – część ubioru, okrycie stopy, oraz często dalszej części nogi.<br />\r\n	Składa się z podeszwy i cholewki. Najczęstszym materiałem była skóra, chociaż spotyka się również obuwie tekstylne, gumowe czy drewniane.<br />\r\n	 </p>','',754,1,'obuwie','','',''),(2240,'Bielizna','<p>\r\n	Część bielizny jest ściśle przeznaczona do noszenia pod innymi ubraniami, podczas gdy inne (jak np. T-shirt czy szorty) mogą być noszone zarówno pod spodem jak i jako normalne ubranie.</p>','',755,1,'bielizna','','','');
