INSERT INTO `contentcategorytranslation` (`idcontentcategorytranslation`, `name`, `languageid`, `contentcategoryid`, `keyword_title`, `keyword`, `keyword_description`, `description`) VALUES (227,'Dla kupującego',1,22,'','','',NULL),(262,'Kontakt',1,25,'','','','<p>\r\n	Dane kontaktowe</p>'),(263,'Mapa serwisu',1,35,'','','',''),(265,'Aktualności',1,46,'','','',''),(266,'Producenci',1,27,'','','',''),(268,'Punkty stacjonarne',1,23,'','','','<p>\n	Tutaj należy wpisać informacje dot. punktów stacjonarnych i możliwości odbioru</p>'),(269,'Marki własne',1,28,'','','','<p>\n	Tutaj proszę umieścić informacje dot. marek własnych sprzedawanych w sklepie.</p>'),(270,'Historia firmy',1,24,'','','','<p>\n	Tutaj proszę umiescić informacje dot. historii powstania sklepu i firmy.</p>'),(271,'Sprzedaż hurtowa',1,26,'','','','<p>\n	Tutaj proszę umiescić informacje dotyczące sprzedaży hurtowej i B2B.</p>'),(273,'Regulamin',1,29,'','','','<p>\n	 </p>\n<p>\n	<span style=\"background-color:#ffff00;\">Przykładowy regulamin sklepu internetowego. Regulamin stanowi tylko przykład i powinien być opracowany w zgodzie z praktykami stosowanymi przez sklep.</span></p>\n<p>\n	<strong>Postanowienia ogólne</strong><br /><br />\n	Sklep <strong>XYZ</strong> obsługiwany przez Przedsiebiorstwo <strong>ABC</strong>, ul. Przykładowa 14, 00-000 Przykładowo,  REGON: 000000000, NIP: 000-000-00-00, zwaną dalej <strong>SklepInternetowy.pl</strong></p>\n<p>\n	<br /><strong>Warunki dokonywania zakupów</strong><br /><br />\n	SklepInternetowy.pl prowadzi sprzedaż produktów za pomocą sklepu internetowego dostępnego pod adresem http://www.sklepinternetowy.pl. Do realizacji zamówień w SklepInternetowy.pl konieczny jest komputer z przeglądarką internetową i dostępem do Internetu.<br /><br /><strong>Oferta i realizacja zakupów</strong><br /><br />\n	W każdej paczce z zamówieniem wysyłany jest dokument poświadczający zakup (pragon, lub na życzenie klienta faktura).<br /><br />\n	Podstawowym warunkiem realizacji dokonanych zakupów jest prawidłowe złożenie zamówienia na stronach sklepu, wybór formy płatności i sposobu przesłania wybranego produktu bądź produktów.<br /><br />\n	Wszystkie ceny podawane w sklepie SklepInternetowy.pl są cenami wyrażonymi w złotych polskich (PLN) i zawierają podatek VAT. <br /><br /><strong>Reklamacje, zwroty i gwarancje</strong><br /><br />\n	Zamawiający ma prawo, żądać doprowadzenia reklamowanego produktu (-ów) do stanu zgodnego z umową poprzez nieodpłatną naprawę albo wymianę. Jeżeli SklepInternetowy.pl nie będzie w stanie wywiązać się z określonych żądań, klient ma prawo domagać się stosowanego obniżenia ceny albo może odstąpić od umowy.<br /><br />\n	Zamawiający może odstąpić od umowy bez podania przyczyn, składając stosowne oświadczenie na piśmie w terminie dziesięciu dni, liczonym od dnia wydania rzeczy. Do zachowania tego terminu wystarczy wysłanie oświadczenia przed jego upływem.<br /><br />\n	Kontakt w sprawie reklamacji, gwarancji i zwrotów: Przedsiebiorstwo XYZ, ul. Przykładowa 14. 00-000 Przykładowo, tel. (000) 000 00 00, e-mail <a href=\"mailto:info@sklepinternetowy.pl\">info@sklepinternetowy.pl</a><br /><br /><br /><strong>Postanowienia końcowe</strong><br /><br />\n	SklepInternetowy.pl zobowiązuje się do ochrony danych osobowych zgodnie z ustawą z dnia 29 sierpnia 1997 r. „O ochronie danych osobowych\".<br /><br />\n	Wypełnienie formularza z danymi Zamawiającego równoznaczne jest ze zgodą na przechowywanie oraz przetwarzanie podanych danych osobowych do celów realizacji i rozliczania transakcji. Dane osobowe Zamawiającego będą przetwarzane wyłącznie w celu realizacji złożonego zamówienia, w tym wystawienia faktury lub rachunku i prowadzenia sprawozdawczości finansowej. Dane te są poufne i nie będą ujawniane osobom trzecim. Klient ma prawo do wglądu do własnych danych osobowych oraz ich poprawek, a także usunięcia z bazy danych. W tym celu należy wysłać wiadomość z określoną dyspozycją na adres e-mail: info@sklepinternetowy.pl. <br /><br />\n	Dane dotyczące numeru karty płatniczej i rachunku bankowego, nie są znane Sprzedającemu. Autoryzacja elektronicznych form płatności odbywa się na stronach internetowych odpowiednich banków lub firmy Polcard.<br /><br />\n	W sprawach nieuregulowanych niniejszym regulaminem mają zastosowanie artykuły kodeksu cywilnego.</p>\n<p>\n	 </p>'),(275,'Dostawa',1,32,'','','','<p>\n	Tutaj należy zawrzeć informacje dotyczące możliwych metod dostawy oraz związanych z nimi kosztami oraz warunkami specjalnymi.</p>'),(276,'Dostępność towarów',1,33,'','','','<p>\n	Tutaj powinny znaleźć się informacje dot. czasów realizacji towarów, czynników wpływających na te czasy oraz dostępności produktów.</p>'),(277,'Płatności',1,34,'','','','<p>\n	Tutaj powinny znaleźć się informacje dot. dozwolonych metod płatności oraz - jeśli istnieją - warunków szczególnych przy użyciu danych metod</p>'),(278,'Zwroty, Gwarancja',1,30,'','','','<p>\n	<span style=\"background-color:rgb(255,255,0);\">Przykładowy regulamin sklepu internetowego. Regulamin stanowi tylko przykład i powinien być opracowany w zgodzie z praktykami stosowanymi przez sklep.</span></p>\n<p>\n	<strong>Reklamacje, zwroty, gwarancje</strong><br /><br />\n	Zamawiający ma prawo, żądać doprowadzenia reklamowanego produktu (-ów) do stanu zgodnego z umową poprzez nieodpłatną naprawę albo wymianę. Jeżeli SklepInternetowy.pl nie będzie w stanie wywiązać się z określonych żądań, klient ma prawo domagać się stosowanego obniżenia ceny albo może odstąpić od umowy.<br /><br />\n	Zamawiający może odstąpić od umowy bez podania przyczyn, składając stosowne oświadczenie na piśmie w terminie dziesięciu dni, liczonym od dnia wydania rzeczy. Do zachowania tego terminu wystarczy wysłanie oświadczenia przed jego upływem.<br /><br />\n	Kontakt w sprawie reklamacji, gwarancji i zwrotów: Przedsiebiorstwo XYZ, ul. Przykładowa 14. 00-000 Przykładowo, tel. (000) 000 00 00, e-mail <a href=\"mailto:info@sklepinternetowy.pl\">info@sklepinternetowy.pl</a></p>'),(282,'O firmie',1,21,'','','','<p>\r\n	O firmie</p>');
