CREATE TABLE `productattributeset` (
  `idproductattributeset` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `productid` int(10) unsigned NOT NULL,
  `suffixtypeid` int(10) unsigned NOT NULL,
  `value` decimal(16,2) NOT NULL DEFAULT '0.00',
  `adddate` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `stock` int(10) unsigned NOT NULL DEFAULT '0',
  `attributegroupnameid` int(10) unsigned DEFAULT NULL,
  `attributeprice` decimal(15,4) DEFAULT NULL,
  `discountprice` decimal(15,4) DEFAULT NULL,
  `symbol` varchar(128) DEFAULT NULL,
  `weight` decimal(15,3) DEFAULT '0.000',
  `status` tinyint(1) unsigned NOT NULL DEFAULT '1',
  `availablityid` int(11) unsigned DEFAULT NULL,
  `photoid` int(11) unsigned DEFAULT NULL,
  `firmesid` int(11) DEFAULT NULL,
  PRIMARY KEY (`idproductattributeset`),
  KEY `FK_productattributeset_productid` (`productid`),
  KEY `FK_productattributeset_suffixtypeid` (`suffixtypeid`),
  KEY `FK_productattributeset_attributegroupnameid` (`attributegroupnameid`),
  KEY `FK_productattributeset_availablityid` (`availablityid`),
  KEY `FK_productattributeset_photoid` (`photoid`),
  KEY `FK_productattributeset_symbol` (`symbol`),
  CONSTRAINT `FK_productattributeset_attributegroupnameid` FOREIGN KEY (`attributegroupnameid`) REFERENCES `attributegroupname` (`idattributegroupname`) ON DELETE CASCADE ON UPDATE NO ACTION,
  CONSTRAINT `FK_productattributeset_availablityid` FOREIGN KEY (`availablityid`) REFERENCES `availablity` (`idavailablity`) ON DELETE SET NULL ON UPDATE NO ACTION,
  CONSTRAINT `FK_productattributeset_photoid` FOREIGN KEY (`photoid`) REFERENCES `file` (`idfile`) ON DELETE SET NULL ON UPDATE NO ACTION,
  CONSTRAINT `FK_productattributeset_productid` FOREIGN KEY (`productid`) REFERENCES `product` (`idproduct`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=158 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC;
