INSERT INTO `producttranslation` (`idproducttranslation`, `productid`, `name`, `shortdescription`, `description`, `languageid`, `seo`, `keyword_title`, `keyword`, `keyword_description`, `longdescription`) VALUES (881,674,'Czapka Etnies Stacks Starter','<p>\n	Nie tylko nowoczesny i piękny design ale przede wszystkim wygoda i perfekcyjne wykonanie. To wszystko sprawia, że czapka Stacks Starter jest prawdziwym must have dla fanów wszelkiego rodzaju sportów miejskich i skate.</p>','',1,'czapka-etnies-stacks-starter','','','',''),(926,694,'Algida Cornetto Chocolate Vanilia','<p>\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Rożek </span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Cornetto Algida</strong><span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"> to rozpływające się w ustach </span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">puszyste, waniliowe lody</strong><span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"> z kuszącą polewą, skryte w chrupiącym wafelku. Smak wanilii i chrupiący waflek sprawią, że każdy kęs będzie dawką przyjemności. Zasmakuj przyjemności życia z rożkiem Cornetto Algida!</span></p>','',1,'algida-cornetto-chocolate-vanilia','','','',''),(927,695,'Domestos Acti - Blitz Original Koszyk','<p>\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Domestos WC Acti-Blitz to linia kostek toaletowych</span></strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">, które, co potwierdzono naukowo, jako jedyne dostępne obecnie na rynku<span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\"> </span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">zawierają  niezawodną formułę, aby pozbyć się bakterii w Twojej toalecie</strong>. Po każdym spłukaniu wody Domestos WC Acti-Blitz czyści toaletę, daje podmuch prawdziwej świeżości oraz skutecznie walczy z bakteriami pozostającymi w misce toalety. Używany w połączeniu z płynem czyszcząco-dezynfekującym Domestos 24H zapewnia komplesową dezynfekcję toalety.</span></p>','<p>\n	 </p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Kostki Domestos WC Acti-Blitz dostępne są w trzech wariantach zapachowych:</strong>                           </p>\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Pine Fresh</strong> – leśnym</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Lemon Fresh</strong> – cytrynowym</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Original</strong> – prawdziwym zapachu czystości</li>\n</ul><p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Produkt biobójczy – należy używać z zachowaniem szczególnych środków ostrożności. Przed użyciem należy przeczytać etykietę i ulotkę informacyjną.</p>',1,'domestos-acti-blitz-original-koszyk','','','',''),(952,703,'ELITE IV Silikon','<p>\n	Bardzo wysokie figi wyprodukowane w technologii bezszwowej. Nie odznaczają się pod ubraniem.</p>','<p>\n	ELITE IV Silikon -  bestseller na polskim rynku! Bardzo wysokie figi wyprodukowane w technologii bezszwowej. Nie odznaczają się pod ubraniem. Spłaszczą Twój brzuch, wymodelują linię talii, bioder i pośladków, abyś wyglądała wyjatkowo w każdej, nawet obcisłej kreacji! Dodatkowo dzięki paskowi silikonu umieszczonemu na wykończeniu fig - nie zsuwają się, podnosząc tym samym komfort noszenia!</p>',1,'elite-iv-silikon','','','',''),(970,700,'Adidas eau de toilette pour homme Team Force','<p>\n	Zapach dla tych, których pragną kobiety i szanują mężczyźni. Nuta głowy: cytrusy Nuta serca: zielona gruszka, jaśmin Nuta bazowa: zapachy drzewne, piżmo.</p>','<p>\n	Adidas eau de toilette pour homme to wody toaletowe dla mężczyzn pewnych siebie. Dodadzą Ci pozytywnej energii i sprawią, że wszystko będzie dla Ciebie możliwe! Szeroki wybór zapachów pozwoli Ci znaleźć ten najbardziej odpowiedni. Wody dostępne w 3 pojemnościach- 30 ml, 50 ml oraz 100 ml.</p>',1,'adidas-eau-de-toilette-pour-homme-team-force','','','',''),(971,699,'Dermika Rosarium new garden woda toaletowa','','',1,'dermika-rosarium-new-garden-woda-toaletowa','','','',''),(972,698,'Gosh Gosh Feeling zestaw zapachowy','<p>\n	Zapachy pobudzają nasze zmysły. Dzięki nim możemy zwrócić na siebie uwagę, przyciągnąć wzrok. Chcąc poczuć się atrakcyjnie, zmysłowo, szczęśliwie, zwycięsko zalecamy skorzystać z różnorodności linii zapachowych Gosh Feeling. Pełnię zapachu uzyskamy korzystając z pełnej linii kosmetyków. W takiej mgiełce zapachowej Gosh Feeling możesz ruszać na podbój świata! Do każdego nastroju i każdej sytuacji możemy wybrać odpowiednią linię zapachową z serii Gosh Feeling for women oraz Gosh Feeling for men.</p>','<p>\n	To właśnie zapachy pobudzają zmysły mężczyzn i sprawiają, że nie są w stanie się oprzeć żadnej kobiecie. Jeśli chcesz oczarować swojego mężczyznę, na randkę użyj wody toaletowej Gosh Feeling Sensual. Nałóż ja na skronie, kark, a pod wpływem ciepła Twojej skóry nuta różana zamieni się w kuszący afrodyzjak. W nucie podstawowej jest wanilia. Obudzi ona wspaniałe wspomniana z dzieciństwa i da poczucie bezpieczeństwa.</p>',1,'gosh-gosh-feeling-zestaw-zapachowy','','','',''),(973,697,'Ariel Color &amp; Style proszek do kolorowych tkanin','<p>\n	Ariel Color &amp; Style pomoże Ci właściwie zadbać o Twoje kolorowe ubrania. Kolory Twoich ubrań na dłużej pozostają żywe i intensywne. Ariel Color &amp; Style przeznaczony jest do prania tkanin kolorach i ciemnych w temperaturach od 30°C do 95°C. Rekomendujemy niskie temperatury, aby zachować jak najlepszy wygląd tkanin na dłużej.</p>\n<p>\n	 </p>','',1,'ariel-color-style-proszek-do-kolorowych-tkanin','','','',''),(974,696,'Cif Brilliance Orchidea','<p>\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Cif to marka środków czyszczących, na której możesz polegać. </span></strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Mleczka i płyny Cif pomogą uporać się nawet z najbardziej opornym brudem w Twoim domu i poza nim, jednocześnie <strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">dbając o czyszczone powierzchnie</strong>. Dom z Cifem to piękny i zadbany dom.</span></p>','<p>\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Cif Brillance Orchidea</strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"> to płyn do </span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">mycia podłóg</strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">oraz innych </span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">gładkich powierzchni</strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"> o pięknym zapachu orchidei. Już niewielka ilość płynu rozpuszczona w wodzie doskonale </span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">wyczyści i odświeży</strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"> podłogi, kafelki czy terakoty oraz nada im niepowtarzalny połysk i pozostawi przyjemny zapach. Cif Brillance sprawi, że powierzchnie w twoim domu <strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">będą </strong></span><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">piękne i czyste</strong><span style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">.</span></p>',1,'cif-brilliance-orchidea','','','',''),(975,693,'BoboVita obiadek Makaron z kabaczkiem, kurczakiem i pomidorami po 9 miesiącu','<p>\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Obiadek przeznaczony dla dzieci po 9 miesiącu życia.</span></p>','<p>\n	 </p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	- właściwe proporcje składników <br />\n	- idealna konsystencja do nauki żucia <br />\n	- bez konserwantów, sztucznych barwników i dodatków aromatycznych <br />\n	- nie zawiera mleka <br /><br /><strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Skł