e=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Czy wiesz, że..?</strong> Naturalnie słodki i łagodny smak marchewki łączy się idealnie ze smakiem owoców. Dlatego deserki owocowo-warzywne są tak delikatne i pyszne!</p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Deser dla dzieci po 4 miesiącu życia.</p>',1,'bobovita-deser-banany-z-brzoskwinia-i-marchewka-po-4-miesiacu','','','',''),(980,688,'100 sposobów na bezpieczeństwo Sieci','<p>\n	<b style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Zbiór porad dla wszystkich, którzy chcą zabezpieczyć swój komputer</b></p>\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Zainstaluj systemy wykrywania włamań</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Zabezpiecz pocztę elektroniczną</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Ochroń swój system operacyjny</li>\n</ul>','<p>\n	 </p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Internet, mimo wielu zalet, niesie za sobą zagrożenie -- wielu ludzi wykorzystuje go do działalności niezgodnej z prawem. Każdego dnia krakerzy włamują się do niezabezpieczonych komputerów, zamieniając je w przekaźniki spamu lub wykorzystując jako narzędzia do ataków blokady usług, ukrywając za ich pomocą swoją tożsamość.</p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	\"100 sposobów na bezpieczeństwo Sieci\" to zbiór porad, dzięki którym zabezpieczysz swój komputer przed atakami sieciowych napastników. Każdy z przykładów został przetestowany w praktyce przez specjalistów zajmujących się na co dzień ochroną danych i systemów. Dzięki nim ochronisz komputer przed najbardziej wyrafinowanymi i przebiegłymi atakami.</p>\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Bezpieczeństwo systemu Windows -- poprawki, zabezpieczanie portów i dzienników zdarzeń</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Bezpieczeństwo systemu Unix -- zabezpieczanie usług i plików</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Zabezpieczanie Sieci -- korzystanie z zapór ogniowych, certyfikatów i szyfrowania</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Rejestrowanie zdarzeń i monitorowanie Sieci</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Metody wykrywania włamań i reagowanie na ataki</li>\n</ul><p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	\"100 sposób na bezpieczeństwo Sieci\" to książka przydatna każdemu użytkownikowi internetu. Dzięki niej, oszczędzając czas, zaimplementujesz sprawdzone i skuteczne mechanizmy zabezpieczeń.</p>',1,'100-sposobow-na-bezpieczenstwo-sieci','','','',''),(981,687,'100 sposobów na Linux Server. Wskazówki i narzędzia dotyczące integracji, monitorowania i rozwiązywania problemów','<p>\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Linux zdobywa coraz większą popularność. Wszędzie, gdzie mamy do czynienia z zarządzaniem sieciami komputerowymi, bezpieczeństwem danych czy potrzebą nieprzerwanej, stabilnej pracy systemu, bardzo często będziemy mieli do czynienia z serwerem linuksowym.</span></p>','<p>\n	 </p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Linux zdobywa coraz większą popularność. Wszędzie, gdzie mamy do czynienia z zarządzaniem sieciami komputerowymi, bezpieczeństwem danych czy potrzebą nieprzerwanej, stabilnej pracy systemu, bardzo często będziemy mieli do czynienia z serwerem linuksowym. System Linux nieustannie rzuca wyzwanie największym producentom oprogramowania i stanowi bardzo poważną alternatywę wobec konkurencyjnych rozwiązań.</p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Autorzy książki \"100 sposobów na Linux Server. Wskazówki i narzędzia dotyczące integracji, monitorowania i rozwiązywania problemów\" przedstawiają ogrom praktycznej wiedzy z zakresu administracji serwerem Linux. Obaj pracowali jako administratorzy systemów, zatem doskonale wiedzą, z jakimi problemami spotykają się na co dzień użytkownicy Linuksa. Dzięki poradom zawartym w książce nawet zaawansowani użytkownicy odkryją wiele nowych sposobów usprawniających ich pracę. W przejrzystej formie przedstawiono instrukcje opisujące krok po kroku rozwiązania, dzięki którym Twój system będzie wydajny, bezpieczny i użyteczny. Wszystko krótko i na temat!</p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	W książce znajdziesz między innymi:</p>\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Kontrolowanie procesu uwierzytelniania w Linuksie</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Administrowanie pamięcią masową w sieci z użyciem kwot dyskowych, klonowania, snapshotów i systemów RAID</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Instalacja i konfiguracja serwera Kerberos</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Podłączanie graficznego interfejsu użytkownika do zdalnych systemów</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Odzyskiwanie danych z uszkodzonych systemów plików</li>\n</ul>',1,'100-sposobow-na-linux-server-wskazowki-i-narzedzia-dotyczace-integracji-monitorowania-i-rozwiazywania-problemow','','','',''),(982,686,'ABC fotografii cyfrowej','<p>\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Fotografia cyfrowa to rewelacja. Możliwości pstrykania tysięcy zdjęć bez martwienia się o koszty obróbki filmów i zamawiania \"po jednym z udanych\" spowodowały, że liczba amatorów robienia zdjęć gwałtownie wzrosła.</span></p>','<p>\n	 </p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Fotografia cyfrowa to rewelacja. Możliwości pstrykania tysięcy zdjęć bez martwienia się o koszty obróbki filmów i zamawiania \"po jednym z udanych\" spowodowały, że liczba amatorów robienia zdjęć gwałtownie wzrosła. Niestety, równocześnie nie wzrósł poziom wiedzy o fotografowaniu. Dzieci z czerwonymi oczami, zdjęcia lasu z widoczną w rogu figurką babci, linia horyzontu przebiegająca po przekątnej, zdjęcia na których widać jedynie nogi uwiecznionej postaci -- oto tylko niektóre przykłady \"dzieł\" autorstwa tych, którym wydaje się, że odpowiednio drogi sprzęt sam zrobi zdjęcie, a jakikolwiek inny przycisk lub pokrętło poza spustem migawki to coś, czego lepiej nie ruszać, bo można zepsuć aparat. Na pewno nie chcesz, aby zaliczano Cię do tej grupy \"fotografów\".</p>\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\n	Wiadomości zawarte w niniejszej książce to gwarancja tego, że nigdy nie będziesz wstydził się wykonanych przez siebie zdjęć. Poznasz tutaj rodzaje aparatów cyfrowych, dowiesz się, jak są skonstruowane i do czego służą poszczególne elementy regulacyjne. Nauczysz się korzystać z programów tematycznych i samodzielnie dobierać parametry ekspozycji. Poznasz zasady komponowania ujęć i fotografowania różnych obiektów. Dowiesz się, w jaki sposób obrabiać fotografie cyfrowe i jak je drukować.</p>\n<p>\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Poruszane w tekście zagadnienia to:</span></p>\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Podstawowe wiadomości o aparatach cyfrowych.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Wykorzystywanie możliwości sprzętu.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Reguły kompozycji zdjęć.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Ekspozycja -- światło naturalne i lampa błyskowa.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Fotografowanie natury, ludzi i architektury.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Prostowanie i kadrowanie zdjęć cyfrowych.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Korekcja kolorystyki i błędnego naświetlenia.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Retuszowanie portretów.</li>\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\n		Drukowanie zdjęć.</li>\n</ul><p>\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Chcesz fotografować z głową? Tutaj znajdziesz wszystkie informacje, które są do tego niezbędne</span></p>',1,'abc-fotografii-cyfrowej','','','',''),(989,676,'Czapka Etnies Chevy','<p>\n	Klasyczna pozycja dla skaterów. Wyrazisty wzór podkreśla charakter użytkownika. W tej czapce zostaniesz zapamiętany na długo.</p>','',1,'czapka-etnies-chevy','','','',''),(1001,685,'ActionScript. Przewodnik encyklopedyczny','<p>\r\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Flash jest już standardem dla sieciowych multimediów, dostępnych dla ponad 250 milionów użytkowników na całym świecie. Książka \"ActionScript.</span></p>','<p>\r\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Flash jest już standardem dla sieciowych multimediów, dostępnych dla ponad 250 milionów użytkowników na całym świecie. Książka \"ActionScript. Przewodnik encyklopedyczny\" to pełna dokumentacja języka ActionScript -- zorientowanego obiektowo języka programowania, będącego podstawowym narzędziem tworzenia zaawansowanych witryn internetowych dla programistów Flasha. Jest kierowana zarówno do projektantów i grafików, którzy dopiero uczą się programowania, jak i do programistów JavaScript, którzy chcą przenieść swoje umiejętności na język ActionScript (oba te języki opierają się na tym samym standardzie ECMAScript).</span></p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	Colin Moock nieraz już dowiódł umiejętności przekazywania swojej szerokiej wiedzy w praktyczny i przystępny sposób. W pełni zasłużył sobie na uznanie, jakim darzą go użytkownicy Flasha.</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	W pierwszej części książki opisano podstawowe zagadnienia programistyczne (zmienne, typy danych, operatory, wyrażenia, funkcje, zdarzenia, tablice i obiekty), poświęcając dużo uwagi ich wykorzystaniu, szczególnie w obróbce klipów filmowych. Druga część jest poświęcona typowym zastosowaniom ActionScriptu, takim jak przetwarzanie formularzy sieciowych. Trzecia część, stanowiąca leksykon języka, zawiera opis zmiennych globalnych, właściwości, metod, detektorów zdarzeń i obiektów wraz z przykładami ich użycia.</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	Korzystając z tej książki szybko opanujesz język ActionScript. Prócz teorii znajdziesz tu praktyczne wskazówki i przykłady prezentujące tworzenie pól tekstowych, przycisków menu, quizów, witryn opartych o dokumenty XML, gier, w których obowiązują zasady praw fizyki, środowisk dla wielu użytkowników działających w czasie rzeczywistym i wielu innych. Skrupulatne opisy poruszają wiele nieudokumentowanych lub niezbadanych dotychczas tematów.</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	\"Najlepsza książka o języku ActionScript, jaką widziałem. Trudno znaleźć gdzie indziej więcej informacji na temat tego języka\". -- Slavik Lozben, główny inżynier Flasha w firmie Macromedia</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	\"Colin Moock napisał najbardziej miarodajną z wszystkich publikacji na temat tworzenia skryptów we Flashu. Nigdzie indziej nie sposób znaleźć opisu języka ActionScript tak wyczerpującego, praktycznego i dokładnego -- Jeremy Clark, kierownik produkcji programu Macromedia Flash</p>',1,'actionscript-przewodnik-encyklopedyczny','','','',''),(1059,690,'BoboVita Dwupak zupa - Rosół z kurczakiem po 9 miesiącu','<p>\r\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Białe mięsa - np. kurczaka i indyka, są bardzo delikatne w smaku, a mięso czerwone jest naturalnie intensywniejsze. Dlatego BoboVita proponuje zupy z dodatkiem różnorodnych mięs.</span></p>','<p>\r\n	 </p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Warto, by obiad składał się z dwóch dań: zupy i drugiego dania. Dlatego BoboVita obok pysznych obiadków proponuje także bogaty wybór zup Na pierwsze danie, które możesz stopniowo wprowadzać jako doskonały początek obiadu Twojego dziecka. Ich smak i konsystencja przypomina ulubione zupy domowe, a powstały ze sprawdzonych i starannie wybranych warzyw, mięsa oraz ziemniaków lub zbóż.</strong></p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	- właściwe proporcje składników <br />\r\n	- idealna konsystencja do nauki żucia <br />\r\n	- bez konserwantów, sztucznych barwników i dodatków aromatycznych <br />\r\n	- nie zawiera mleka</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Skład:</strong> woda, mięso z kurczaka, marchew, makaron (pszenica, białko jaja kurzego), seler, pietruszka, skrobia kukurydziana, por, cebula, olej rzepakowy, natka pietruszki, czarny pieprz.</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	<strong style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">Czy wiesz, że...?</strong> Białe mięsa - np. kurczaka i indyka, są bardzo delikatne w smaku, a mięso czerwone jest naturalnie intensywniejsze. Dlatego BoboVita proponuje zupy z dodatkiem różnorodnych mięs.</p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	Zupka przeznaczona dla dzieci po 9 miesiącu życia.</p>',1,'bobovita-dwupak-zupa-rosol-z-kurczakiem-po-9-miesiacu','','','',''),(1064,702,'Emerica Westgate','<p>\r\n	Wulkanizowana guma daje maksimum przyczepności i dużą odporność na ścieranie. To są buty prawdziwie przeznaczone do zadań specjalnych!</p>','',1,'emerica-westgate','','','',''),(1067,692,'Bebiko 2R po 6 miesiącu','<p>\r\n	Białe mięsa - np. kurczaka i indyka, są bardzo delikatne w smaku, a mięso czerwone jest naturalnie intensywniejsze. Dlatego BoboVita proponuje zupy z dodatkiem różnorodnych mięs.</p>','',1,'bebiko-2r-po-6-miesiacu','','','',''),(1069,689,'.NET CLR. Księga eksperta','<p>\r\n	 </p>\r\n<ul style=\"padding:0px;margin:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Poznaj działanie Common Language Runtime -- podstawowego składnika platformy .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Wykorzystując CLR pisz aplikacje .NET szybciej i wdrażaj je łatwiej</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Poznaj i wykorzystaj wewnętrzne mechanizmy działania platformy .NET</li>\r\n</ul>','<p>\r\n	 </p>\r\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Poznaj działanie Common Language Runtime -- podstawowego składnika platformy .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Wykorzystując CLR pisz aplikacje .NET szybciej i wdrażaj je łatwiej</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Poznaj i wykorzystaj wewnętrzne mechanizmy działania platformy .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Skorzystaj z zaawansowanych technik wykrywania i usuwania usterek w aplikacjach</li>\r\n</ul><p>\r\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\".NET CLR. Księga eksperta\" to całościowe opracowanie poświęcone głównemu składnikowi platformy .NET Microsoftu, jakim jest Common Language Runtime. CLR pozwala na korzystanie z dowolnych języków programowania zgodnych z .NET udostępniając im wspólne usługi. Niezależnie od tego, czy uruchamiasz kod napisany w VB, C#, zarządzanym C++, JScripcie czy też w dowolnym innym obsługiwanym przez platformę .NET języku -- wykorzystywane są funkcje i usługi CLR.</span></p>\r\n<p style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">\r\n	Tematy poruszone w książce obejmują m.in.:</p>\r\n<ul style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;list-style:none;color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\"><li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Typy .NET i Common Type System (CTS)</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Strukturę i układ metadanych podzespołu .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Współpracę COM i COM+ z komponentami .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Integrację z bibliotekami Win32 DLL poprzez P/Invoke</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Zarządzanie pamięcią i zasobami w CLR</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Zarządzanie i użycie wątków w środowisku .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Tworzenie wydajnych aplikacji do obsługi sieci równorzędnych</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Tworzenie rozproszonych aplikacji</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Interakcje aplikacji poprzez zdarzenia i delegaty</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Obsługę błędów w .NET przy użyciu wyjątków</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Tworzenie i obsługę bezpiecznych aplikacji dzięki zabezpieczeniom .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Dynamiczne uzyskiwanie informacji o typach poprzez refleksję</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Użycie narzędzi do globalizacji i lokalizacji</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Usuwanie błędów aplikacji .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Profilowanie aplikacji .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Omówienie składni C# i najważniejszych kwestii związanych z tym językiem</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Przegląd bibliotek struktury .NET</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Tworzenie własnego hosta CLR</li>\r\n	<li style=\"margin:0px;padding:0px;border:0px;vertical-align:baseline;background-color:transparent;\">\r\n		Porównanie CLR i JVM</li>\r\n</ul><p>\r\n	<span style=\"color:rgb(0,0,0);font-family:\'lucida Grande\', Helvetica, Tahoma, Verdana, Arial, sans-serif;line-height:15px;text-align:justify;\">Jeżeli chcesz zajmować się pisaniem aplikacji opartych na .NET, \".NET CLR. Księga eksperta\" stanowić będzie cenne uzupełnienie Twojej wiedzy i pozwoli na lepsze zrozumienie zasad, na których oparta jest ta platforma.</span></p>',1,'-net-clr-ksiega-eksperta','','','',''),(1071,678,'Figi korekcyjne IGA','<p>\r\n	Figi korygujące, mocna dzianina poliamidowa tworzy z przodu i z tyłu pas zbierający obfitości brzucha oraz bioder. Dół slipów wykonany jest z bawełny, co zapewnia komfort podczas codziennego użytkowania.</p>','',1,'figi-korekcyjne-iga','','','',''),(1074,683,'Majtki wyszczuplające ELITE FORTE','<p>\r\n	To wysokie szorty bezszwowe, które dzięki idealnemu dopasowywaniu się do ciała, stają się niewidoczne pod ubraniami. Dzięki dodatkowym wzmocnieniom dzianiny wspaniale wymodelująTwój brzuch, uda i pośladki! </p>','<p>\r\n	Dzięki paskowi silikonu umieszczonemu na górze wykończenia szortów - nie zsuwają się, podnosząc tym samym komfort noszenia! Wydłużone nogawki zapobiegają wszelkim otarciom między udami podczas chodzenia. Zewnętrzna satynowa powłoka nadaje wyrobom poślizg ułatwiający układanie się odzieży.</p>\r\n<p>\r\n	 </p>',1,'majtki-wyszczuplajace-elite-forte','','','',''),(1076,682,'Półgorset wyszczuplający LAURA','<p>\r\n	LAURA - to unikalny półgorset wyszczuplająco - modelujący. Spłaszcza brzuch, wygładza sylwetkę, ściąga i opina. Zastosowanie metalowych fiszbin sprawia, że talia jest idealnie zarysowana. Miseczka typu push-up podnosi biust i nadaje mu ponętnych kształtów. Istnieje możliwość odpinania ramiączek . Niezaprzeczalnym atutem jest kryty (nie odznaczający się) zamek błyskawiczny z przodu.</p>\r\n<p>\r\n	 </p>','',1,'polgorset-wyszczuplajacy-laura','','','',''),(1082,701,'Etnies Salem','<p>\r\n	Wulkanizowana guma daje maksimum przyczepności i dużą odporność na ścieranie. To są buty prawdziwie przeznaczone do zadań specjalnych!</p>','',1,'etnies-salem','','','',''),(1083,684,'Stringi wyszczuplające ELITE V','','',1,'stringi-wyszczuplajace-elite-v','','','',''),(1084,681,'Majtki wyszczuplające XEN','<p>\r\n	IRA –  wyszczuplający pas do pończoch . Wykonany z mocnej lecz przepuszczającej powietrze dzianiny.  Idealnie modeluje linię bioder i brzuch (dodatkowo wzmocniony przód).  Dostępny w trzech kolorach oraz w dużych rozmiarach.</p>\r\n<p>\r\n	 </p>','',1,'majtki-wyszczuplajace-xen','','','',''),(1085,680,'Pas do pończoch IRA','<p>\r\n	IRA –  wyszczuplający pas do pończoch . Wykonany z mocnej lecz przepuszczającej powietrze dzianiny.  Idealnie modeluje linię bioder i brzuch (dodatkowo wzmocniony przód).  Dostępny w trzech kolorach oraz w dużych rozmiarach.</p>\r\n<p>\r\n	 </p>','',1,'pas-do-ponczoch-ira','','','',''),(1086,677,'Buty Etnies Jameson 2 ECO','<p>\r\n	Klasyczne buty dla ludzi w średnim wieku. Stonowana kolorystyka i porządne wykonanie będą procentowały przez kilka sezonów. Warto zainwestować w takie buty.</p>','',1,'buty-etnies-jameson-2-eco','','','',''),(1087,675,'Koszulka Etnies Afro-Disiac','<p>\r\n	Czy ubranie może stać się afrodyzjakiem? Taka koszulka z pewnością może rozpalić zmysły. Załóż na siebie świetnie wykonaną, bawełnianą koszulkę z afrykańskimi wzorami a zobaczysz co potrafi zrobić z wyobraźnią Twoich koleżanek!</p>','',1,'koszulka-etnies-afro-disiac','','','',''),(1095,705,'ISIS','','',1,'isis','','','',''),(1099,704,'Elite II','<p>\r\n	Dzięki bezszwowej technologii figi dokładnie przylegają do ciała - co daje efekt \"drugiej skóry\". Nie odznaczają się pod odzieżą - zapewniając dyskrecję i komfort noszenia.</p>','<p>\r\n	 </p>\r\n<p style=\"padding:5px;margin:0px;line-height:1.3;font-family:Arial, Arial, Helvetica, sans-serif;font-size:11px;text-align:left;background-color:rgb(242,242,242);\">\r\n	<b><font color=\"#a5a5a5\">ELITE II – bezszwowe figi korygujące, modelują brzuch i pośladki.</font></b></p>\r\n<p style=\"padding:5px;margin:0px;line-height:1.3;color:rgb(85,85,85);font-family:Arial, Arial, Helvetica, sans-serif;font-size:11px;text-align:left;background-color:rgb(242,242,242);\">\r\n	Dzięki bezszwowej technologii figi dokładnie przylegają do ciała - co daje efekt \"drugiej skóry\". Nie odznaczają się pod odzieżą - zapewniając dyskrecję i komfort noszenia.</p>\r\n<p style=\"padding:5px;margin:0px;line-height:1.3;color:rgb(85,85,85);font-family:Arial, Arial, Helvetica, sans-serif;font-size:11px;text-align:left;background-color:rgb(242,242,242);\">\r\n	Figi wykonane są z oddychającej kilkuwastwowej dzianiny.  Jej splot zapewnia odprowadzenie wilgoci na zewnątrz, utrzymując skórę suchą. Wykończenie bawełniane dzianiny od wewnątrz daje przyjemny, delikatny chwyt. Zewnętrzna satynowa powłoka nadaje wyrobom poślizg ułatwiający układanie się odzieży.</p>',1,'elite-ii','','','',''),(1102,673,'Koszulka Supra Flytop 3','<p>\r\n	Ekstrawagancka koszulka z nowoczesnym designem. Supra to Marka znana z ubrań cenionych przez znane gwiazdy hip-hop. W zasadzie trudno szukać podobnego modelu na rynku. Ta koszulka z pewnością pozwoli się wyróżnić</p>','',1,'koszulka-supra-flytop-3','','','','<p>\r\n	Koszulka powinna być prana w temperaturze do 40 st. C.</p>'),(1107,672,'Buty Etnies Sheckler 6 Fusion','<p>\r\n	Nowoczesne buty, hit sezonu 2012. Podwyższona odporność na ścieranie zapewni wytrzymałość na kilka sezonów. Wykonanie butów cechowane jest dużą dokładnością - warto zwrócić uwage na okute otworki na sznurowadła.</p>','',1,'buty-etnies-sheckler-6-fusion','','','',''),(1111,679,'Koszulka Body Perfect','<p>\r\n	Nie masz czasu iść na siłownię? Znowu nie mieścisz się w swoją marynarkę? Od dziś to już nie problem! Mamy dla Ciebie świetne rozwiązanie! Firma Mitex stworzyła nową linię bielizny kształtujaco-wyszczuplajacej dla mężczyzn. </p>','<p>\r\n	Nikt nie musi wiedzieć, że masz kilka centymetrów w pasie za dużo. Bielizna BODY PERFECT sprawi, ze w jednej chwili pozbędziesz się „oponki” i ukształtujesz sylwetkę o jakiej zawsze marzyłeś! BODY PERFECT to innowacja na polskim rynku bielizny korygującej!!! Koszulka mocno wyszczuplająca dla mężczyzn, wykonana z cienkiej, a zarazem bardzo mocnej dzianiny. Doskonale modeluje sylwetkę. Spód podszyty bawełną zapewnia komfort noszenia. Dzieki niej pozbędziesz się kilku centymetrów w talii i w okolicach brzucha.</p>\r\n<div>\r\n	 </div>',1,'koszulka-body-perfect','','','','');
